import React, { Component } from 'react';

class WorkOrders extends Component{
    constructor(props){
        super(props);
        this.state = {
            workorders : []
        }
    }

    render(){
        return(
            <div>
                HELLO FROM THE WORKORDER PAGE
            </div>
        )
    }
}

export default WorkOrders;
